    /**
     * Gets the attribute value for the calculated attribute OtherProvidersText.
     * @return the OtherProvidersText
     */
    public String getOtherProvidersText() {
        //return (String) getAttributeInternal(OTHERPROVIDERSTEXT);
        RowIterator iterator = getRep_VbookProviderVo();
       
        String result="";
        Rep_VbookProviderVoRowImpl currProv=null;
        int i=0;
        while(iterator.hasNext()) {
          currProv = (Rep_VbookProviderVoRowImpl)iterator.next();
            if(new Number(1).equals(currProv.getEntryKind()))
                continue;
            i++;
            String role=currProv.getRole()==null?"":"،"+currProv.getRole();
            String bdDate=currProv.getBDDate()==null?"":"،"+currProv.getBDDate();
            String provider=currProv.getProvider1()==null?"":currProv.getProvider1();
            result+=ParsiUtil.getFromAbjad(i)+"."+provider+bdDate+role+". " ;
            
        }
        if(new Number(1).equals(getCutter()))
            result+=ParsiUtil.getFromAbjad(++i)+"."+"عنوان.";
        return result;
    }

